import {useState} from 'react'

const Content = () => {
    const [name, setName] = useState('Alfie')
    const handleClick = (name) => {
        setName = 'Shubham';

    }
    return ( 
        <div className="content">
            <h2>Blog Content</h2>
            <p>Hello Guys! my name is {name}. </p>
            <button className="clickconsolevent" onClick={(e) => handleClick(name)}>Click Me!</button>
        </div>
     );
}
 
export default Content
